import {
  SlBreadcrumbItem
} from "./chunk.XJRALKVM.js";

// src/react/breadcrumb-item/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-breadcrumb-item";
SlBreadcrumbItem.define("sl-breadcrumb-item");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlBreadcrumbItem,
  react: React,
  events: {},
  displayName: "SlBreadcrumbItem"
});
var breadcrumb_item_default = reactWrapper;

export {
  breadcrumb_item_default
};
